import React, { Component } from 'react';

class FetchData extends Component {
  constructor(props) {
    super(props);

    this.state = {
      error: null,
      isLoaded: false,
      items: []
    }
  }

  componentDidMount() {
    fetch("https://api.covid19api.com/summary")
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result.items 
          });
        },

        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
    console.log(items)  
  }

  render() {
    const { error, isLoaded, items} = this.state;

    if (error) {
      return <div> Error: {error.message} </div>
    } else if (!isLoaded) {
      return <div> Loading </div>
    } else {
      return(
        <div>
          <ul>
            {items.map(item => (
              <li key={item.Countries.CountryCode}>
                {item.Countries.Country}
              </li>
            ))}
          </ul>
        </div>
      );
    } 
  }
}

export default FetchData;
